import React from 'react';
import livro from '../../Images/livro.png';
import UltimoLancamento from './UltimoLancamento';

export const livros = [
    { nome: 'React Avançado', id: 1, src: livro },
    { nome: 'CSS para Ninjas', id: 2, src: livro },
    { nome: 'Node.js no Mundo Real', id: 3, src: livro },
    { nome: 'Arquitetura Limpa em PHP', id: 4, src: livro }
];

function UltimosLancamentos() {
    return (
        <section>
            <h2>ULTIMOS LANCAMENTOS</h2>
            {livros.map(livro => (
                <UltimoLancamento key={livro.id} livro={livro} />
            ))}
        </section>
    );
}

export default UltimosLancamentos;
